    [],nt"revision_timestamp": "2015-11-20T22:45:09.138494",nt"name": "reasonable-accommodation-information-tracking-system",nt"isopen":
    false,nt"url": null,nt"notes": "The Reasonable Accommodation Information
    Tracking System (RAITS) is a case management system that allows the National Reasonable
    Accommodation Coordinator (NRAC) and the Local Reasonable Accommodation Coordinators
    (LORAC) to manage information related to Reasonable Accommodation (RA) requests.
    It provides a data base system in compliance with Executive Order 13164 and required
    by the Equal Employment Opportunity Commission (EEOC) Regulations and American Federation
    of Government Employees (AFGE) Bargaining Unit as described in the AFGE National
    Reasonable Accommodation Procedures. It is a tool that was internally developed
    in Lotus Notes to track requests for reasonable accommodation and was custom-configured
    to meet EPA's specific needs and infrastructure.",nt"license_title": null,nt"extras":
